import { Input, Row, Col, Layout, Modal, Tabs, Spin, Button, Switch } from 'antd'
import styled from 'styled-components';

const MainTab = styled(Tabs)`
    .ant-tabs-tab-active{
      color: ${({ theme }) => theme.colors.palette.orange}; ;
    }
    .ant-tabs-tab:hover{
      color: ${({ theme }) => theme.colors.palette.orange}; ;
    }
    .ant-tabs-ink-bar {
      background: ${({ theme }) => theme.colors.palette.orange};
    }
    .ant-btn {
      background: ${({ theme }) => theme.colors.palette.orange}; ;
      border-color: ${({ theme }) => theme.colors.palette.orange}; ;
    }
`

const TcrbSwitch = styled(Switch)`
  ${({ defaultChecked }) => defaultChecked && `
        background-color: #FBA928;
    `}
`
const TcrbButton = styled(Button)`
  .ant-btn-primary{
      background: ${({ theme }) => theme.colors.primary};
      border-color: ${({ theme }) => theme.colors.primary};
  }
  .ant-btn{
    background: ${({ theme }) => theme.colors.default};
    border-color: ${({ theme }) => theme.colors.default};
  }
  background: ${({ theme }) => theme.colors.primary};

`

export {
  MainTab,
  TcrbSwitch,
  TcrbButton
}
